//api.openweathermap.org/data/2.5/weather?q=surat&appid=3313bf85356affb485e03077a8a3806e

import React from 'react'
import './App.css';

const Temp = () => {
  return (
    <div className='wrap'>
        <div className="search">
        <input type='search'
            placeholder='search...'
            autoFocus
            id='search'
            className='searchTerm'
        />
        <button className='searchButton' type='search'>Search</button>
        </div>
    </div>
  )
}

export default Temp
